export const companyFormConfig = [
  [
    {
      name: "companyName",
      label: "Company Name",
      type: "text",
      required: true,
    },
    {
      name: "industry",
      label: "Industry",
      type: "select",
      options: "industryOptions",
      required: true,
    },
    {
      name: "subIndustry",
      label: "Sub Industry",
      type: "select",
      options: "subIndustryOptions",
      required: true,
    },
  ],
  [
    { name: "turnover", label: "Turnover", type: "text", required: true },
    {
      name: "employeeCount",
      label: "Employee Count",
      type: "number",
      required: true,
    },
    {
      name: "country",
      label: "Country",
      type: "select",
      options: "countryOptions",
      required: true,
    },
  ],
  [
    {
      name: "stateRegion",
      label: "State/Region",
      type: "select",
      options: "stateOptions",
      required: true,
    },
    { name: "city", label: "City", type: "text", required: true },
    { name: "pinCode", label: "Pin Code", type: "text", required: true },
  ],
  [
    { name: "website", label: "Website", type: "url", required: true },
    { name: "linkedIn", label: "LinkedIn", type: "url", required: true },
    {
      name: "companyEmail",
      label: "Company Email",
      type: "email",
      required: true,
    },
  ],
];

export const contactFormConfig = [
  {
    role: "IT",
    fields: [
      { name: "itName", label: "Name", type: "text", required: true },
      { name: "itEmail", label: "Email", type: "email", required: true },
      { name: "itDlExt", label: "DL/Ext", type: "text", required: false },
      {
        name: "itDesignation",
        label: "Designation",
        type: "text",
        required: true,
      },
      { name: "itMobile", label: "Mobile", type: "tel", required: true },
      {
        name: "itPersonalEmail",
        label: "Personal Email",
        type: "email",
        required: false,
      },
    ],
  },
  {
    role: "Finance",
    fields: [
      { name: "financeName", label: "Name", type: "text", required: true },
      { name: "financeEmail", label: "Email", type: "email", required: true },
      { name: "financeDlExt", label: "DL/Ext", type: "text", required: false },
      {
        name: "financeDesignation",
        label: "Designation",
        type: "text",
        required: true,
      },
      { name: "financeMobile", label: "Mobile", type: "tel", required: true },
      {
        name: "financePersonalEmail",
        label: "Personal Email",
        type: "email",
        required: false,
      },
    ],
  },
  {
    role: "Business Head",
    fields: [
      { name: "businessHeadName", label: "Name", type: "text", required: true },
      {
        name: "businessHeadEmail",
        label: "Email",
        type: "email",
        required: true,
      },
      {
        name: "businessHeadDlExt",
        label: "DL/Ext",
        type: "text",
        required: false,
      },
      {
        name: "businessHeadDesignation",
        label: "Designation",
        type: "text",
        required: true,
      },
      {
        name: "businessHeadMobile",
        label: "Mobile",
        type: "tel",
        required: true,
      },
      {
        name: "businessHeadPersonalEmail",
        label: "Personal Email",
        type: "email",
        required: false,
      },
    ],
  },
];

export const itLandscapeConfig = {
  netNew: [
    [
      {
        name: "erp",
        label: "ERP",
        type: "select",
        options: "erpOptions",
        required: true,
      },
      {
        name: "erpVersion",
        label: "ERP Version",
        type: "text",
        required: true,
      },
      {
        name: "erpImplementationPartner",
