        type: "number",
        required: true,
      },
    ],
    [
      {
        name: "erpGoLiveDate",
        label: "ERP Go-Live Date",
        type: "date",
        required: true,
      },
      {
        name: "erpContractRenewalDate",
        label: "ERP Contract Renewal Date",
        type: "date",
        required: true,
      },
    ],
  ],
  SAPInstalledBase: [
    [
      {
        name: "sapProduct",
