        required: true,
      },
    ],
    [
      {
        name: "sapLicenseCost",
        label: "SAP License Cost",
        type: "number",
        required: true,
      },
      {
        name: "sapAnnualMaintenanceCost",
        label: "SAP Annual Maintenance Cost",
        type: "number",
        required: true,
      },
      {
        name: "sapImplementationCost",
        label: "SAP Implementation Cost",
        type: "number",
        required: true,
      },
    ],
    [
      {
        name: "sapGoLiveDate",
        label: "SAP Go-Live Date",
        type: "date",
        required: true,
      },
      {
        name: "sapContractRenewalDate",
        label: "SAP Contract Renewal Date",
